import React from "react";

import "../../index.css";
import LandingPageNavbar from "./sections/LandingPageNavbar";
import Me from "../../assets/me.jpeg";
import { Col, Row } from "react-bootstrap";
import { Link } from "react-router-dom";

const LandingPage = () => {
  return (
    <Col className="">
      <LandingPageNavbar/>
      <div className="mt-5">
        <div className="full">
          <Row className="bad-gateway-row">
            <Col md="8">
              <h2 className="h2-responsive mt-3 mb-2">404. That's an error.</h2>
              <h4>The requested URL was not found on this server.</h4>
            </Col>
            <Col md="4">
              <img
                className="img-fluid langing-img p-3"
                src={Me}
                alt="hi"
                style={{
                  borderRadius: "45% 40% 50% 70%/50% 50% 70% 60%"
                }}
              />
            </Col>
            <Link to="/">Back to Home</Link>
          </Row>
        </div>
      </div>
      {/* <div className="logo-wrapper waves-effect">
          <img
            className="img-fluid langing-img"
            src={Me}
            alt="hi"
            style={{
              borderTopLeftRadius: "50px",
              borderBottomLeftRadius: "50px"
            }}
          />
        </div> */}
    </Col>
  );
};

export default LandingPage;
